import { Button } from "@mui/material";

const Footer = () => {
    return (
      <div
        style={{
          textAlign: "center",
          marginBottom: 10,
        }}
      >
        <Button
            variant="contained"
            color="primary"
            size="large"
          >
            Profile
          </Button>
          <Button
            variant="contained"
            color="primary"
            size="large"
          >
            Create
          </Button>
          <Button
            variant="contained"
            color="primary"
            size="large"
          >
            Home
          </Button>
      </div>
    );
  };

  export default Footer;
